-- ----------------------------
-- Table structure for channel_users
-- ----------------------------
DROP TABLE IF EXISTS `channel_users`;
CREATE TABLE `channel_users`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID标识',
  `channel_num` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '渠道商编号',
  `channel_suffix` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '渠道后缀',
  `channel_user_num` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '渠道用户ID',
  `channel_user_name` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '渠道用户名',
  `user_num` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '账号ID',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `is_user_num`(`user_num`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '渠道用户' ROW_FORMAT = Dynamic;

