DROP TABLE IF EXISTS `error_callback`;
CREATE TABLE `error_callback`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID标识',
  `channel_pkg_num` int(11) UNSIGNED NOT NULL COMMENT '渠道ID',
  `my_order_num` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单号',
  `callback_url` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '回调地址',
  `callback_data` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '回调数据',
