  `last_time` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '最后处理时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 7 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '回调CP错误日志' ROW_FORMAT = Dynamic;

