  `charge12_lz_count` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '官方12日充值次数',
  `charge13_lz_count` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '官方13日充值次数',
  `charge14_lz_count` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '官方14日充值次数',
  `charge15_lz_count` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '官方15日充值次数',
  `charge30_lz_count` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '官方30日充值次数',
  `charge60_lz_count` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '官方60日充值次数',
  PRIMARY KEY (`game_user_num`) USING BTREE,
  UNIQUE INDEX `ix_usernum_channelpkg`(`user_num`, `channel_pkg_num`) USING BTREE,
  INDEX `ix_channelpkgnum_packnum`(`channel_pkg_num`, `pack_num`) USING BTREE,
  INDEX `ix_channelpkgnum_regsource`(`channel_pkg_num`, `reg_source`) USING BTREE,
  INDEX `ix_create_d`(`create_d`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 90000000178 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '游戏玩家表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of game_users
-- ----------------------------

-- ----------------------------
-- Table structure for mes_send
-- ----------------------------
DROP TABLE IF EXISTS `mes_send`;
CREATE TABLE `mes_send`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `channel_pkg_num` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '渠道包ID',
  `phone_number` bigint(32) UNSIGNED NOT NULL COMMENT '电话号码',
  `code` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '验证码',
  `type` enum('0','1','2','3') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '验证码类型:0=未知,1=注册,2=登录,3=重置密码',
  `msg` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '发送内容',
  `time` int(11) UNSIGNED NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `p_c_t_index`(`phone_number`, `code`, `type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 65 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '验证码' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of mes_send
-- ----------------------------

-- ----------------------------
-- Table structure for offline_pay
-- ----------------------------
DROP TABLE IF EXISTS `offline_pay`;
CREATE TABLE `offline_pay`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID标识',
  `order_num` bigint(20) UNSIGNED NULL DEFAULT 0 COMMENT '订单号',
  `p_type` enum('1','2','3') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '1' COMMENT '状态:1=微信,2=支付宝,3=其它',
  `money` decimal(14, 2) UNSIGNED NULL DEFAULT NULL COMMENT '金额（元）',
  `code_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '二维码连接地址',
  `c_time` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '二维码创建时间',
  `status` enum('1','2','3') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '1' COMMENT '状态:1=创建,2=回调,3=成功',
  `cb_time` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '回调时间',
  `bkinfo` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '备注',
  `codeimage` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '二维码保存地址',
  `admin_id` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '创建人',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uni_ix_ordernum`(`order_num`) USING BTREE,
  INDEX `ix_cbtime`(`cb_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 85 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '线下充值记录' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of offline_pay
-- ----------------------------

-- ----------------------------
-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders`  (
  `order_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID标识',
  `my_order_num` bigint(20) UNSIGNED NULL DEFAULT 0 COMMENT '订单号',
  `pt_order_num` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '平台订单号',
  `request_data` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '回调数据',
  `real_amount` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '真实金额',
  `amount` int(11) UNSIGNED NOT NULL COMMENT '金额',
  `source` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '订单来源',
  `remark` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '备注',
  `user_num` bigint(20) UNSIGNED NOT NULL COMMENT '账号ID',
  `user_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '账号名',
  `game_num` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '游戏ID',
  `channel_pkg_num` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '渠道包ID',
  `os_type` enum('1','2','3','4','5') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '1' COMMENT '系统:1=IOS,2=安卓,3=H5,4=微信小程序,5=QQ小程序',
  `bundle` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '',
  `currency` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '币种',
  `product_num` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '产品ID',
  `product_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '产品名称',
  `product_desc` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '产品描述',
  `server_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '服务器ID',
  `server_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '服务器名称',
  `role_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '角色ID',
  `role_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '角色名称',
  `role_level` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '角色等级',
  `extra` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '透传参数',
  `notify_url` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '回调地址',
  `cp_order_num` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT 'CP订单号',
  `time` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '请求创建时间',
  `create_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `pay_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付时间',
  `complete_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '完成时间',
  `state` enum('1','2','3','4','5','6','7','8') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '1' COMMENT '状态:1=下单,2=验证receipt,3=验证receipt成功,4=回调CP,5=完成发货,6=已手动补单,7=已手动回调CP,8=计划任务回调CP',
  `last_notice` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最后通知时间',
  `notice_times` int(11) NOT NULL COMMENT '通知次数',
  `notice_result` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '通知结果',
  `gateway_num` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '网关ID',
  `settle_amount` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '结算金额',
  `settle_currency` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '结算币种',
  PRIMARY KEY (`order_id`) USING BTREE,
  UNIQUE INDEX `ix_my_order_num`(`my_order_num`) USING BTREE,
  INDEX `ix_pt_order_num`(`pt_order_num`) USING BTREE,
  INDEX `ix_channel_num`(`channel_pkg_num`) USING BTREE,
  INDEX `ix_game_num`(`game_num`) USING BTREE,
  INDEX `ix_user_num_channel_num`(`user_num`, `channel_pkg_num`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 311 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单记录' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of orders
-- ----------------------------

-- ----------------------------
-- Table structure for receipt_record
-- ----------------------------
DROP TABLE IF EXISTS `receipt_record`;
CREATE TABLE `receipt_record`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID标识',
  `my_order_num` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单号',
  `money` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '充值金额(分)',
  `receipt` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '购买凭证',
  `md5_receipt` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '购买凭证MD5',
  `rtn_info` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'receipt经过苹果验证后的返回结果',
  `state` enum('1','2','3') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '1' COMMENT '购买凭证状态:1=插入,2=支付失败,3=支付成功(apple返回成功)',
  `create_time` int(11) UNSIGNED NOT NULL COMMENT '创建时间',
  `complete_time` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '完成时间',
  `last_time` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '最后请求时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `ix_my_order_num`(`my_order_num`) USING BTREE COMMENT '订单号索引',
  INDEX `ix_md5_re_uni`(`md5_receipt`) USING BTREE COMMENT 'receipt的MD5索引'
) ENGINE = InnoDB AUTO_INCREMENT = 36 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'IOS正版充值购买凭证储存表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of receipt_record
-- ----------------------------

-- ----------------------------
-- Table structure for user_logs
-- ----------------------------
DROP TABLE IF EXISTS `user_logs`;
CREATE TABLE `user_logs`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `user_num` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '账号ID',
  `user_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '账号名称',
  `game_num` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '游戏ID',
  `channel_pkg_num` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '渠道包ID',
  `channel_num` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '渠道商ID',
  `pack_num` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '包ID',
  `b_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '包标识',
  `ads_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '广告ID',
  `ip` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT 'IP',
  `device_num` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '设备ID',
  `device_num_md5` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '设备IDMD5',
  `device_model` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '设备类型',
  `mac` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT 'MAC',
  `os_type` enum('1','2','3','4','5') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '1' COMMENT '系统:1=IOS,2=安卓,3=H5,4=微信小程序,5=QQ小程序',
  `os_version` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '系统版本',
  `net_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '网络类型',
  `country` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '国家',
  `province` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '省份',
  `city` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '城市',
  `opt_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '添加时间',
  `opt_d` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '添加日期',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `ix_usernum`(`user_num`) USING BTREE,
  INDEX `ix_gamenum_channelpkgnum`(`game_num`, `channel_pkg_num`) USING BTREE,
  INDEX `ix_channelpkgnum`(`channel_pkg_num`) USING BTREE,
  INDEX `ix_opt_d`(`opt_d`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 152 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '用户日志' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of user_logs
